import {useState} from "react";
import {useNavigate} from "react-router-dom";
import {toast} from 'react-hot-toast';
import axios from "axios";
import "./register.css";
import type {Role} from "../../model/role.model";

function Register  ()   {
    const navigate = useNavigate()
    const [data, setData] = useState({
        name : '',
        email: '',
        username: '',
        contact: '',
        password: '',
        roles: [],
    })

    const registerAdmin = async () => {
        //e.preventDefault()
        const {name, email, username, contact, password, roles} = data
        try {
            const {data} = await axios.post('/admin/register', {
                name,
                email,
                username,
                contact,
                password,
                roles,
            });
            setData({...data, roles: [{"id": 0, "version": 0, "name": ""}]})
            if(data.error) {
                toast.error(data.error)
            } else {
                //setData({});
                navigate('/admin')
            }
        } catch (error) {

        }
    }

    const loginAdmin = () => {
        //setData({});
        navigate('/admin');
    }

    return (
        <div>
            {/* TopBar Component */}
            <div className="login">
                <div className="lContainer">
                    <input
                        type="text"
                        placeholder="Name"
                        id="name"
                        onChange={(e) => setData({...data, name: e.target.value})}
                        className="lInput"
                    />
                    <input
                        type="text"
                        placeholder="Email"
                        id="email"
                        onChange={(e) => setData({...data, email: e.target.value})}
                        className="lInput"
                    />
                    <input
                        type="text"
                        placeholder="Username"
                        id="username"
                        onChange={(e) => setData({...data, username: e.target.value})}
                        className="lInput"
                    />
                    <input
                        type="text"
                        placeholder="Contact"
                        id="contact"
                        onChange={(e) => setData({...data, contact: e.target.value})}
                        className="lInput"
                    />
                    <input
                        type="password"
                        placeholder="Password"
                        id="password"
                        onChange={(e) => setData({...data, password: e.target.value})}
                        className="lInput"
                    />
                    <button onClick={registerAdmin} className="lButton">
                        Register
                    </button>
                    <button onClick={loginAdmin} className="lButton">
                        Login
                    </button>
                </div>
            </div>
        </div>
    );
}
export default Register
